import React from 'react'
import {
	FormikWizardProvider,
	Wizard,
	StepsList,
	Step,
	ButtonsList,
	PreviousButton,
	NextButton,
	SubmitButton
} from  "formik-wizard-form";
import SignUpForm2 from './SignUpForm2.js'
import PaymentInfo from './PaymentInfo.js'
import AppsYouHave from './AppsYouHave.js'

const UserForm = (props) => (
	<FormikWizardProvider {...props}>
		{(renderProps) => (
			<Wizard {...renderProps}>
				<StepsList>
					<Step component={SignUpForm2} title="SignUpForm2" />
					<Step component={PaymentInfo} title="Contact Details" />
					<Step component={AppsYouHave} title="Address Details" />
				</StepsList>
				<ButtonsList>
					<PreviousButton />
					<NextButton />
					<SubmitButton />
				</ButtonsList>
			</Wizard>
		)}
	</FormikWizardProvider>
)

// Finally wrap this form in withFormik higher order component given by formik
const ActualForm = withFormik(
    mapPropsToValues
)(UserForm);


const mapStateToProps = ({ auth }) => ({
    loading: auth.loading,
    error: auth.error,
})

const mapDispatchToProps = {
    signUp: actions.signUp,
    cleanUp: actions.clean,
}

export default connect(mapStateToProps, mapDispatchToProps)(WizardForm)
